
from collections import Counter
def isValid(s):
    # Write your code here
    counter_s = Counter(s)
    val_list = list(counter_s.values())
    
    counter_val_list = Counter(val_list)
    if len(counter_val_list) > 2:
        return "NO"

    max_val = max(val_list)
    min_val = min(val_list)
    if max_val == min_val:
        return "YES"
    
    cnt_max = 0
    cnt_min = 0
    for i in val_list:
        if i == max_val:
            cnt_max += 1
        elif i == min_val:
            cnt_min += 1
    if (cnt_min == 1 and min_val == 1) or (cnt_max == 1 and max_val == min_val+1):
        return "YES"
    return "NO"


print(isValid(""))

print(isValid("aaaaabc"))

print(isValid(""))

